tables.table_schema:
CREATE TABLE qualitative_research (
    study_id INT PRIMARY KEY,
    researcher_name VARCHAR(50),
    research_topic TEXT,
    observation_date DATE
);

CREATE TABLE Qualitative_Researchers (
    researcher_id INT PRIMARY KEY,
    researcher_name VARCHAR(50),
    research_area VARCHAR(100)
);

CREATE TABLE Relational_Data_Models (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(50),
    model_description TEXT,
    research_data JSON
);

CREATE TABLE researchers (
    researcher_id INT PRIMARY KEY,
    researcher_name VARCHAR(255),
    research_field VARCHAR(255)
);

CREATE TABLE research_projects (
    project_id INT PRIMARY KEY,
    project_name VARCHAR(255),
    researcher_id INT,
    project_description TEXT
);

CREATE TABLE project_contributors (
    contribution_id INT PRIMARY KEY,
    project_id INT,
    contributor_name VARCHAR(255),
    contribution_amount DECIMAL(10, 2)
);

CREATE TABLE researchers (
    researcher_id INT PRIMARY KEY,
    researcher_name TEXT,
    research_interests TEXT
);

CREATE TABLE studies (
    study_id INT PRIMARY KEY,
    study_title TEXT,
    researcher_id INT,
    FOREIGN KEY (researcher_id) REFERENCES researchers (researcher_id)
);

CREATE TABLE analysis (
    analysis_id INT PRIMARY KEY,
    study_id INT,
    analysis_results TEXT,
    FOREIGN KEY (study_id) REFERENCES studies (study_id)
);
